import React from "react";
import {
  ContainerLinks,
  Logo,
  ProfileIcon,
  Row,
  ContainerMenu,
  LinkHome,
  ButtonLogout,
  ButtonLogin,
  Button,
} from "./styles";
import { useNavigate } from "react-router-dom";
import profile from "../../assets/profile.svg";
import home from "../../assets/home.svg";

const Header = () => {
  const isLoggedIn = true;
  const navigate = useNavigate();
  function logout() {
    console.log("logout");
    navigate("/login");
  }

  function login() {
    console.log("login");
    navigate("/login");
  }

  function gallery() {
    console.log("gallery");
    navigate("/gallery");
  }

  return (
    <>
      <header>
        <ContainerLinks>
          <LinkHome title="Home Page" to="/">
            <Logo src={home} alt="logo" />
          </LinkHome>
          <ContainerMenu>
            {isLoggedIn ? (
              <>
              /*
              quando se clica chama a função de logout
              */
                <ButtonLogout onClick={logout}>Logout</ButtonLogout>
                <Button onClick={() => navigate("/addbook")}>Add Book</Button>
                <a title="Your Profile" href="/profile">
                  <ProfileIcon src={profile} alt="Profile icon" />
                </a>
              </>
            ) : (
              <>
                <ButtonLogin onClick={login}>Login</ButtonLogin>
                <ButtonLogin onClick={gallery}>Gallery</ButtonLogin>
              </>
            )}
          </ContainerMenu>
        </ContainerLinks>
      </header>
      <Row />
    </>
  );
};

export default Header;
